docstring:
Collects all Guild emojis and sends them as zipped file.

Example:
    @AntiPetros all_guild_emojis

Simulates a coin flip and posts the result as an image of a Petros Dollar.

Example:
    @AntiPetros flip_coin

Shows all server of the Antistasi Community, that are currently online.

Example:
    @AntiPetros current_online_server

Shows some info of the Antistasi Guild.

Example:
    @AntiPetros info_guild

Shows Info about the Bot itself.

Example:
    @AntiPetros info_bot

Reports all collected metrics as Graph.

Example:
    @AntiPetros report

Removes all messages of the bot and optionally of giddi.

Example:
    @AntiPetros purge_antipetros -gid yes -n 1000

Gives a List of all currently active and loaded Cogs.

Example:
    @AntiPetros current_cogs

Posts and awesome ASCII Art Dragon!

Example:
    @AntiPetros the_dragon
